0.ds_documentacao:
- comprovante de conclusão do ensino médio ou equivalente, sendo:
a) duas fotocópias autenticadas do histórico escolar, se o candidato advém do ensino não profissionalizante; ou
b) duas fotocópias autenticadas do diploma, registrado no órgão competente, se o candidato advém do ensino médio profissionalizante; ou
c) duas fotocópias autenticadas do diploma e duas fotocópias autenticadas do respectivo histórico escolar, se o candidato classificado possui escolarização de nível superior; ou
d) declaração de equivalência de estudos fornecida por órgão credenciado no Brasil, se o candidato concluiu o ensino médio fora do país.
- duas fotocópias autenticadas da cédula de identidade civil ou militar;
- comprovante impresso de inscrição no Cadastro de Pessoas Físicas, CPF;
- uma fotocópia autenticada de documento que comprove estar em dia com o Serviço Militar, para candidatos do sexo masculino entre 19 e 45 anos (completos ou a serem completados no ano de ingresso no curso);
- duas fotografias recentes tamanho 3x4 cm;
- laudo médico, para pessoas com deficiência, que ateste o tipo, o grau ou o nível da deficiência. 

Além dos documentos acima relacionados, o candidato de nacionalidade estrangeira deve apresentar para efetivação de sua matrícula:
- uma fotocópia da página de identificação do passaporte ou documento de identificação para cidadãos do Mercosul;
- duas fotocópias do visto de estudante, quando for o caso;
- duas fotocópias do RNE, válido à data do Registro Acadêmico.

